import React, {useEffect, useState} from 'react'
import { Button, Table, InputGroup, Form, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import FederationForm from './components/FederationForm.js';

function App(){
  // useStates and initiatings

  const [meetData, setMeetData] = useState([])
  const [filteredMeetData, setFilteredMeetData] = useState([])

  const [search, setSearch] = useState('') 

  const [page, setPage] = useState(1)
  const [pageCount, setPageCount] = useState(0)

  const [federationOptions, setFederationOptions] = useState([])
  const [federationFilter, setFederationFilter] = useState([])

  const itemsPerPage = 10

  // part 1: initiates federation options
  useEffect(() => {
    fetch('/meets')
    .then((response) => {
      return response.json()
    })
    .then(data => {
      setFederationOptions(data.fedOptions)
      })
  }, [])
  // part 2: federation options => federation filter
  useEffect(() => {
    setFederationFilter(federationOptions)
  }, [federationOptions])

  // part 3: federation filter => federation data
  useEffect(() => {
    if (federationFilter.length <= 0){
      return
    } 
    fetch(`/meets?${queryParameters.toString()}`)
      .then((response) => {
        return response.json()
      })
      .then(data => {
        setMeetData(data.info)
        }
      )
  }, [federationFilter])

  // filters
  const filters = {
    federation: federationFilter // OR effect for categories
  };

  const queryParameters = new URLSearchParams();
  for (const key in filters) {
    if (Array.isArray(filters[key])) {
      filters[key].forEach(value => {
        queryParameters.append(key, value);
      });
    } else {
        queryParameters.append(key, filters[key]);
    }
  }
  // regulates pages
  useEffect(() => {
    setPage(1)
    setPageCount(Math.ceil(filteredMeetData.length / itemsPerPage))
  }, [filteredMeetData])

  function filterNames(){
    let t1 = filteredMeetData.slice((page - 1) * itemsPerPage, page * itemsPerPage) // filter pages
    return t1
  }

  // query filtering pt 2
  useEffect(() => {
    let t1 = meetData.filter(i => i.name.toLowerCase().includes(search.toLowerCase())) // filter names
    setFilteredMeetData(t1)
  }, [search, meetData])

  return (
    <Container>
      <div>
			  <h1>HTML5/JavaScript Map</h1>
			  <div style="max-width: 700px">
				  <div id="map"></div>
			  </div>
			  <div>Please read the <a href="http://simplemaps.com/docs">documentation</a> to learn how to customize this map.</div>
		  </div>
      <h1 className='text-center mt-4'>Powerlifting Meets</h1>
      <FederationForm federations={federationOptions} setFederationFilter={setFederationFilter} federationFilter={federationFilter}/>
      <Button as="input" type="reset" value="Reset" onClick={() => setFederationFilter(federationOptions)} />
      <Form>
        <InputGroup className='my-3'>
          <Form.Control onChange={(e) => setSearch(e.target.value)} placeholder='filter events'></Form.Control>
        </InputGroup>
      </Form>
      <Table>
        <thead>
           <tr>
            <th>Federation</th>
            <th>Name</th>
            <th>When</th>
            <th>State</th>
          </tr>
        </thead>
        <tbody>
        {filterNames(meetData).map((item) => (
          <tr>
            <td>{item.federation}</td>
            <td>{item.name}</td>
            <td>{item.date}</td>
            <td>{item.state}</td>
          </tr>
        ))}
        </tbody>
      </Table>
      <button disabled={page === 1} onClick={() => setPage(page - 1)}>Last Page</button>
      <button disabled={page === pageCount} onClick={() => setPage(page + 1)}>Next Page</button>
      <button onClick={() => setPage(1)}>Reset</button>
      <select onChange={(event) => {setPage(event.target.value)}} value={page}> 
      {Array(pageCount).fill(null).map((_, index) => { 
        return <option key={index}>{index + 1}</option>
      })} 
      </select>
    </Container>
  )
}

export default App;
